import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { getUsers, getVisits, getVisitors } from '../utils/LocalStorageService';

const AdminDashboardPage = () => {
  const [users, setUsers] = useState([]);
  const [visits, setVisits] = useState([]);
  const [filters, setFilters] = useState({
    startDate: '',
    endDate: '',
    hostName: '',
    visitorName: ''
  });
  const [error, setError] = useState('');

  useEffect(() => {
    try {
      const usersData = getUsers();
      const visitsData = getVisits();
      const visitors = getVisitors();
      setUsers(usersData);

      let filteredVisits = visitsData;

      if (filters.startDate) {
        filteredVisits = filteredVisits.filter(v => new Date(v.check_in_time) >= new Date(filters.startDate));
      }
      if (filters.endDate) {
        filteredVisits = filteredVisits.filter(v => new Date(v.check_in_time) <= new Date(filters.endDate));
      }
      if (filters.hostName) {
        const hostUsers = usersData.filter(u => u.role === 'host' && u.name.toLowerCase().includes(filters.hostName.toLowerCase()));
        const hostIds = hostUsers.map(u => u.id);
        filteredVisits = filteredVisits.filter(v => hostIds.includes(v.host_id));
      }
      if (filters.visitorName) {
        const visitorMatches = visitors.filter(vis => vis.name.toLowerCase().includes(filters.visitorName.toLowerCase()));
        const visitorIds = visitorMatches.map(vis => vis.id);
        filteredVisits = filteredVisits.filter(v => visitorIds.includes(v.visitor_id));
      }

      const visitsWithDetails = filteredVisits.map(visit => {
        const visitor = visitors.find(vis => vis.id === visit.visitor_id) || {};
        const host = usersData.find(u => u.id === visit.host_id) || {};
        return { ...visit, visitor, host };
      });

      setVisits(visitsWithDetails);
    } catch (err) {
      setError('Failed to load data');
    }
  }, [filters]);

  const handleFilterChange = (e) => {
    setFilters(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleFilterSubmit = (e) => {
    e.preventDefault();
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('role');
    localStorage.removeItem('name');
    window.location.reload();
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <nav className="bg-white shadow-lg">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16">
            <div className="flex items-center">
              <span className="text-2xl font-bold text-gray-800">Visitor Management</span>
            </div>
            <div className="flex items-center space-x-4">
              <Link to="/" className="text-gray-600 hover:text-gray-900">Home</Link>
              <Link to="/products" className="text-gray-600 hover:text-gray-900">Products</Link>
              <Link to="/resources" className="text-gray-600 hover:text-gray-900">Resources</Link>
              <Link to="/aboutus" className="text-gray-600 hover:text-gray-900">About Us</Link>
              <Link to="/bookademo" className="text-gray-600 hover:text-gray-900">Book a Demo</Link>
              <Link to="/contactus" className="text-gray-600 hover:text-gray-900">Contact Us</Link>
              <button 
                onClick={handleLogout} 
                className="text-gray-600 hover:text-gray-900 font-medium"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </nav>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
          <h2 className="text-2xl font-bold text-gray-800 mb-6">Admin Dashboard</h2>
          {error && <p className="text-red-500 mb-4">{error}</p>}

          <section className="mb-8">
            <h3 className="text-xl font-semibold text-gray-700 mb-4">Users</h3>
            <div className="overflow-x-auto">
              <table className="w-full text-left border-collapse">
                <thead>
                  <tr className="bg-gray-50">
                    <th className="p-3 text-gray-600 font-semibold">Name</th>
                    <th className="p-3 text-gray-600 font-semibold">Email</th>
                    <th className="p-3 text-gray-600 font-semibold">Role</th>
                  </tr>
                </thead>
                <tbody>
                  {users.length === 0 ? (
                    <tr><td colSpan="3" className="p-3 text-center text-gray-500">No users found</td></tr>
                  ) : (
                    users.map(user => (
                      <tr key={user.id} className="border-t hover:bg-gray-50">
                        <td className="p-3">{user.name}</td>
                        <td className="p-3">{user.email}</td>
                        <td className="p-3">{user.role}</td>
                      </tr>
                    ))
                  )}
                </tbody>
              </table>
            </div>
          </section>

          <section>
            <h3 className="text-xl font-semibold text-gray-700 mb-4">Visitor Logs</h3>
            <div className="bg-gray-50 p-4 rounded-lg mb-6">
              <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Start Date</label>
                  <input 
                    type="date" 
                    name="startDate" 
                    value={filters.startDate} 
                    onChange={handleFilterChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">End Date</label>
                  <input 
                    type="date" 
                    name="endDate" 
                    value={filters.endDate} 
                    onChange={handleFilterChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Host Name</label>
                  <input 
                    name="hostName" 
                    value={filters.hostName} 
                    onChange={handleFilterChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Visitor Name</label>
                  <input 
                    name="visitorName" 
                    value={filters.visitorName} 
                    onChange={handleFilterChange}
                    className="w-full p-2 border rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                  />
                </div>
              </div>
              <button 
                onClick={handleFilterSubmit}
                className="mt-4 bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 transition-colors"
              >
                Filter
              </button>
            </div>

            <div className="overflow-x-auto">
              <table className="w-full text-left border-collapse">
                <thead>
                  <tr className="bg-gray-50">
                    <th className="p-3 text-gray-600 font-semibold">Visitor Name</th>
                    <th className="p-3 text-gray-600 font-semibold">Visitor Email</th>
                    <th className="p-3 text-gray-600 font-semibold">Visitor Phone</th>
                    <th className="p-3 text-gray-600 font-semibold">Items Carried</th>
                    <th className="p-3 text-gray-600 font-semibold">Photo</th>
                    <th className="p-3 text-gray-600 font-semibold">Host Name</th>
                    <th className="p-3 text-gray-600 font-semibold">Reason</th>
                    <th className="p-3 text-gray-600 font-semibold">Check-In Time</th>
                    <th className="p-3 text-gray-600 font-semibold">Check-Out Time</th>
                  </tr>
                </thead>
                <tbody>
                  {visits.length === 0 ? (
                    <tr><td colSpan="9" className="p-3 text-center text-gray-500">No visits found</td></tr>
                  ) : (
                    visits.map(visit => (
                      <tr key={visit.id} className="border-t hover:bg-gray-50">
                        <td className="p-3">{visit.visitor?.name || 'Unknown'}</td>
                        <td className="p-3">{visit.visitor?.email || 'Unknown'}</td>
                        <td className="p-3">{visit.visitor?.phone || '-'}</td>
                        <td className="p-3">{visit.visitor?.itemsCarried || '-'}</td>
                        <td className="p-3">
                          {visit.visitor?.photo ? (
                            <img 
                              src={visit.visitor.photo} 
                              alt="Visitor" 
                              className="max-w-[100px] max-h-[100px] rounded-lg shadow-sm"
                            />
                          ) : '-'}
                        </td>
                        <td className="p-3">{visit.host?.name || 'Unknown'}</td>
                        <td className="p-3">{visit.reason || '-'}</td>
                        <td className="p-3">{visit.check_in_time ? new Date(visit.check_in_time).toLocaleString() : '-'}</td>
                        <td className="p-3">{visit.check_out_time ? new Date(visit.check_out_time).toLocaleString() : '-'}</td>
                      </tr>
                    ))
                  )}
                </tbody>
              </table>
            </div>
          </section>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboardPage;
